import React from 'react';

const Navigation = props => {
    return (
            <nav className="fixed-top ml-4 mt-2">
                <ul className="nav">
                    <li onClick={() => props.changePage('Home')} className="nav-item btn btn-danger mx-1">Home</li>
                    <li onClick={() => props.changePage('About Me')} className="nav-item btn btn-danger mx-1">About me</li>
                    <li onClick={() => props.changePage('Star wars')} className="nav-item btn btn-danger mx-1">Star wars</li>
                    <li onClick={() => props.changePage('Contact')} className="nav-item btn btn-danger mx-1">Contact</li>
                </ul>
            </nav>

    );
};

export default Navigation;
